import React from "react";

import './header.css';

const Header = () => {
    return (
        <div className='header'>
            <div className="header__logo">
                <img className='header__logo_img' src="../../images/PHS-logo.svg" alt="logo"/>
            </div>
        </div>
    )
};

export default Header;
